import React, {useState } from "react";
//components
import Map from '../Map/index'

//Styles
import {Wrapper, Content, Nav, MapContainer} from './Form.styles'
import Api from '../../api'
/* link / navLinkto (to) prop använder invoice number för att ladda sidan med
  rätt id
*/

const Admin = () => {
	const [bikes, setBike] = useState(null);


	const getBikes = async (event)  => {

        try {
            let res = await Api.getAllCrimes()
            if (res) {
				setBike(res)
            }
        } catch (error) {
        }
    }

return (
    <Wrapper>
        <Content>
			<Nav>
			<button onClick= {
				getBikes()
			}> Hämta cyklar </button>

			</Nav>
			<MapContainer>
				<Map bikes = {bikes}></Map>
			</MapContainer>
        </Content>
    </Wrapper>
  )
}

export default Admin


